import React from "react";
// import "../styles/HomePage.css";

import bgImage from "../assets/oseaay.jpg";
import { Icon, Paper } from "@mui/material";

const HomePage = () => {
  return (
    <Paper>
      <Icon
        sx={{
          width: "100%",
          display: "flex",

          backgroundSize: "cover",
        }}
      >
        <img alt="" src={bgImage}></img>
      </Icon>
    </Paper>
  );
};

export default HomePage;
